import React from "react";
import {x1 , x2} from '../App';

function T3(){


    return(
        <x1.Consumer>
            
            {
                (a)=>{
                    return (
                        <x2.Consumer>
                            {
                                (b)=>{
                                    return (
                                        <div>
                                            <h1> student name is : {a}</h1>
                                            <h2> his age is {b} </h2>
                                        </div>
                                        
                                    )
                                }
                            }
                        </x2.Consumer>
                    )


                    
                }
            }
        </x1.Consumer>
    )
}

export default T3;
